import React, { useState, useEffect } from "react";
import {
  Grid,
  Card,
  Box,
  Typography,
  Autocomplete,
  TextField,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import MDButton from "components/MDButton";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import { useNavigate } from "react-router-dom";
import { useSession } from " SessionContext";

function Student() {
  const { name, pass } = useSession();
  const [modal, setModal] = useState(false);
  const [editModalOpen, setEditModalOpen] = useState(false);
  const [formData, setFormData] = useState({
    id: null,
    name: "", // Employee name
    email: "", // Employee email
    password: "", // Employee password
    phone: "", // Employee phone
    position: "", // Employee position
    department: "", // Employee department
  });
  const [studentTableData, setStudentTableData] = useState([]);
  const [isAsc, setIsAsc] = useState(true);

  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`http://localhost:5001/employeeData`);
        const jsonData = await response.json();
        setStudentTableData(jsonData);
      } catch (error) {
        console.error('Error fetching employee data:', error);
      }
    };
    fetchData();
  }, []);

  const handleSort = () => {
    const sortedData = [...studentTableData];
    sortedData.sort((a, b) => {
      if (a.department < b.department) return -1;
      if (a.department > b.department) return 1;
      return 0;
    });

    if (isAsc) {
      setStudentTableData(sortedData);
    } else {
      setStudentTableData(sortedData.reverse());
    }

    setIsAsc(!isAsc);
  };

  const handleOpen = () => {
    setModal(true);
  };

  const handleClose = () => {
    setModal(false);
  };

  const handleEditOpen = (data) => {
    // setEditFormData(data);
    setEditModalOpen(true);
  };

  const handleEditClose = () => {
    setEditModalOpen(false);
  };

  const handleDelete = async (id) => {
    try {
      const response = await fetch(`http://localhost:5001/deleteEmployee/${id}`, {
        method: "DELETE",
      });
      const result = await response.json();
      alert("Employee deleted successfully");
      // Fetch data again or update local state if needed
    } catch (error) {
      console.log(error);
    }
  };

  const handleSubmit = async () => {
    try {
      const response = await fetch(`http://localhost:5001/employeeInsert`, {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });
      const result = await response.json();
      alert("Employee added successfully");
      setModal(false);
      // Fetch data again or update local state if needed
    } catch (error) {
      console.log(error);
    }
  };

  const handleEditSubmit = async () => {
    try {
      const response = await fetch(`http://localhost:5001/updateEmployee`, {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          editFormData,
        }),
      });
      const result = await response.json();
      // Update the local state or fetch data again if needed
      // Close the edit modal
      setEditModalOpen(false);
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <DashboardLayout>
      <Box pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <Box
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
                display="flex"
                justifyContent="space-between"
                alignItems="center"
              >
                <DialogTitle>Employee Details</DialogTitle>
                <MDButton color="success" onClick={handleOpen}>
                  Add Employee
                </MDButton>
              </Box>
              <Box pt={3}>
                <TableContainer component={Paper}>
                  <Table>
                    <TableHead>
                      <TableRow>
                        <TableCell>SI.No</TableCell>
                        <TableCell>Name</TableCell>
                        <TableCell>Email</TableCell>
                        <TableCell>Phone</TableCell>
                        <TableCell>Position</TableCell>
                        <TableCell onClick={handleSort}>Department</TableCell>
                        <TableCell>Action</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {studentTableData.map((data, index) => (
                        <TableRow key={index}>
                          <TableCell>{index + 1}</TableCell>
                          <TableCell>{data.name}</TableCell>
                          <TableCell>{data.email}</TableCell>
                          <TableCell>{data.phone}</TableCell>
                          <TableCell>{data.position}</TableCell>
                          <TableCell>{data.department}</TableCell>
                          <TableCell>
                            <Box display="flex" justifyContent="space-between">
                              <MDButton color="info" onClick={() => handleEditOpen(data)}>
                                Edit
                              </MDButton>
                              <MDButton color="error" onClick={() => handleDelete(data.id)}>
                                Delete
                              </MDButton>
                            </Box>
                          </TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                </TableContainer>
              </Box>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </DashboardLayout>
  );
}

export default Student;
